import React from 'react';
import s from './styles/Home.module.css';
var random_name = require('node-random-name');

const Home = () => {
  return (
    <div className={s.container}>
      <div className={s.wrapper1}>
        <img
          src={`https://picsum.photos/${Math.round(
            Math.random() * (700 - 600) + 500
          )}`}
          className={s.img}
        />
        <img
          src={`https://picsum.photos/${Math.round(
            Math.random() * (700 - 600) + 500
          )}`}
          className={s.img}
        />
        <img
          src={`https://picsum.photos/${Math.round(
            Math.random() * (700 - 600) + 500
          )}`}
          className={s.img}
        />
        <img
          src={`https://picsum.photos/${Math.round(
            Math.random() * (700 - 600) + 500
          )}`}
          className={s.img}
        />
        <img
          src={`https://picsum.photos/${Math.round(
            Math.random() * (700 - 600) + 500
          )}`}
          className={s.img}
        />
        <img
          src={`https://picsum.photos/${Math.round(
            Math.random() * (700 - 600) + 500
          )}`}
          className={s.img}
        />
        <img
          src={`https://picsum.photos/${Math.round(
            Math.random() * (700 - 600) + 500
          )}`}
          className={s.img}
        />
        <img
          src={`https://picsum.photos/${Math.round(
            Math.random() * (700 - 600) + 500
          )}`}
          className={s.img}
        />
        <img
          src={`https://picsum.photos/${Math.round(
            Math.random() * (700 - 600) + 500
          )}`}
          className={s.img}
        />
        <img
          src={`https://picsum.photos/${Math.round(
            Math.random() * (700 - 600) + 500
          )}`}
          className={s.img}
        />
      </div>

      <div className={s.wrapper2}>
        <div style={{ display: 'flex', flexDirection: 'row' }}>
          <img
            src={`https://picsum.photos/${Math.round(
              Math.random() * (700 - 600) + 500
            )}`}
            className={s.img3}
          />
          <div style={{ margin: '16px 0px 0px 10px' }}>{random_name({})}</div>
        </div>
        <img
          src={`https://picsum.photos/${Math.round(
            Math.random() * (1080 - 900) + 900
          )}/${Math.round(Math.random() * (700 - 600) + 500)}`}
          className={s.img2}
        />
        <p>{`Uploaded on: ${Math.round(
          Math.random() * (30 - 1) + 1
        )}/${Math.round(Math.random() * (12 - 1) + 1)}/${Math.round(
          Math.random() * (2023 - 2000) + 2000
        )}`}</p>
      </div>
      <hr />
    </div>
  );
};

export default Home;
